#include <bits/stdc++.h>
using namespace std;

int canCompleteCircuit(vector<int> &gas, vector<int> &cost){
   int gasConsumed = 0, gasAvailable = 0, startindex = 0, gasRequired = 0, gasAv = 0, gasReq = 0;
   for (int i = 0; i < gas.size(); i++){
      gasAv += gas[i];
      gasReq += cost[i];
      gasConsumed += gas[i] - cost[i];
      if (gasConsumed < 0){
         startindex = i + 1;
         gasConsumed = 0;
         gasAvailable += gasAv;
         gasAv = 0;
         gasRequired += gasReq;
         gasReq = 0;
      }
   }

   return gasRequired <= (gasAvailable + gasConsumed) ? startindex : -1;
}

